import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './progressbar.css';

class ProgressBar extends Component {
  render() {
    return (
      // navigational progress bar
      <div className="progress" role="progressbar" aria-valuenow={this.props.valueNow} aria-valuemin="0" aria-valuemax="100">
        <div className={"bar " + this.props.step}></div>
      </div>
    )
  }
}

ProgressBar.propTypes = {
  step: PropTypes.any.isRequired,
  valueNow: PropTypes.any.isRequired
}

export default ProgressBar;
